INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, 1, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 24001, 1, 2, 125801, 40011, 0, 321);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, 1, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 24001, 2, 2, 126001, 40011, 0, 322);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (1, 1, "プレシア", "んーと。\nこれ、あげる。\nはい", 24001, 3, 2, 126101, 40011, 0, 323);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 1, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 24001, 4, 2, 125801, 40011, 0, 324);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 1, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 24001, 5, 2, 126001, 40011, 0, 325);
INSERT INTO `v1_90a2b29b229472b90e4d0df85697c5a9a05ecbe52ef8f098ea001865dc08147d` VALUES (2, 1, "プレシア", "お兄。\nきてくれて、うれしい", 24001, 6, 2, 126101, 40011, 0, 326);
